import { Dropdown, Icon, Menu } from 'semantic-ui-react';

type TopMenuProps = {
    mapName: string;
    handleClickMenu: () => void;
    handleClickAdd: () => void;
}

const addOptions = [
    { key: 'spot', text: 'Spot', value: 'spot' },
    { key: 'layer', text: 'Layer', value: 'layer' },
    { key: 'map', text: 'Map', value: 'city' },
]

const menuOptions = [
    { key: 'cities', text: 'Cities', value: 'cities' },
    { key: 'support', text: 'Support', value: 'support' },
    { key: 'login', text: 'Login', value: 'login' },
]

const TopMenu: React.FC<TopMenuProps> = (props) => {
    const { mapName, handleClickMenu, handleClickAdd } = props;
    return (
        <div className="top-menu">
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/semantic-ui/2.4.1/semantic.min.css" />
            <Dropdown
                button
                className='icon'
                icon={'bars'}
                options={menuOptions}
                onChange={handleClickAdd}
            >
                <Menu vertical>
                <Dropdown text='Messages' pointing='left' className='link item'>
      <Dropdown.Menu>
        <Dropdown.Item>Inbox</Dropdown.Item>
        <Dropdown.Item>Starred</Dropdown.Item>
        <Dropdown.Item>Sent Mail</Dropdown.Item>
        <Dropdown.Item>Drafts (143)</Dropdown.Item>
        <Dropdown.Divider />
        <Dropdown.Item>Spam (1009)</Dropdown.Item>
        <Dropdown.Item>Trash</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
                </Menu>    
            </Dropdown>
            <div className='title'>{mapName}</div>
            <Dropdown
                button
                className='icon'
                floating
                icon={'plus'}
                options={addOptions}
                onChange={handleClickAdd}
            />
        </div>
    )
};

export default TopMenu;
